
class Polymer
  attr_reader :units
  def initialize(units)
    @units = units
  end

  def self.of(text)
    new(text.chars)
  end

  def solve
    [react.size, smallest_possible.size]
  end

  def react
    until done?
      destruct
    end

    return @units
  end

  def smallest_possible
    @units.map(&:downcase).uniq.map { |ch|
      sub_string = @units.dup
      sub_string.delete(ch)
      sub_string.delete(ch.upcase)
      Polymer.new(sub_string)
    }.map(&:react)
     .min_by(&:size)
  end

  def destruct
    @index, @last_size = 0, @units.size
    while @index < @units.size - 1
      delete_pair if pair?
      @index += 1
    end

    @destructed
  end

  def delete_pair
    2.times{ @units.delete_at(@index) }
  end

  def pair?
    @units[@index] != @units[@index + 1] &&
      @units[@index].downcase == @units[@index + 1].downcase
  end

  def done?
    @last_size == @units.size
  end
end

